sys_ux_client_script.script:
/**
 * @param {params} params
 * @param {api} params.api
 * @param {TransformApiHelpers} params.helpers
 */
function evaluateProperty({
    api,
    helpers
}) {
    var baseUrl = "https://openweathermap.org/img/wn/";
    var icon = api.data.get_weather_info__rest_1.output.result.weather[0].icon;
    var format = '@4x.png';

    return baseUrl + icon + format;
}
